import React from 'react';
import Navbar from '../../components/Navbar/Navbar';
import Globe from '../../components/Globe/Globe';
import '../../components/styles/home.css';

const Home = () => {
  return (
    <div className="home">
      <Navbar />
      <main className="home-content">
        <section className="intro">
          <p>Explore real-time global problems on our interactive globe and join our mission to spread love by solving one another's problems, inspired by Jesus's teachings of love. "A new command I give you: Love one another. As I have loved you, so you must love one another." - John 13:34. A simple click on the blinking beacon "problem alert" on the virtual globe not only zooms into the precise longitude and latitude of the specific place .</p>
        </section>
        <Globe />
        <section className="features">
          <p><a href="/solutions" className="features-link">Discover innovative solutions addressing global problems.</a></p>
        </section>
      </main>
    </div>
  );
};

export default Home;
